import{_ as e,c as t,o as T,ap as h}from"./chunks/framework.BIf3juHF.js";const B=JSON.parse('{"title":"ETH质押？","description":"","frontmatter":{"head":[["link",{"rel":"canonical","href":"https://v2vv.com/guide/build"}],["meta",{"property":"og:title","content":"ETH质押？"}]]},"headers":[],"relativePath":"guide/build.md","filePath":"guide/build.md"}'),E={name:"guide/build.md"};function H(i,a,r,n,l,o){return T(),t("div",null,a[0]||(a[0]=[h('<h1 id="eth质押" tabindex="-1">ETH质押？ <a class="header-anchor" href="#eth质押" aria-label="Permalink to &quot;ETH质押？&quot;">​</a></h1><h2 id="兑换率呈线性变化还是浮动变化" tabindex="-1">兑换率呈线性变化还是浮动变化？ <a class="header-anchor" href="#兑换率呈线性变化还是浮动变化" aria-label="Permalink to &quot;兑换率呈线性变化还是浮动变化？&quot;">​</a></h2><p>WBETH价值的增加会体现在每日WBETH∶BETH兑换率的更新上。然而，每次更新的实际价值增长会浮动变化，具体取决于链上ETH质押的年利率。</p><h2 id="如果我从市场上购买到wbeth-我是否能获得wbeth中累积的奖励" tabindex="-1">如果我从市场上购买到WBETH，我是否能获得WBETH中累积的奖励？ <a class="header-anchor" href="#如果我从市场上购买到wbeth-我是否能获得wbeth中累积的奖励" aria-label="Permalink to &quot;如果我从市场上购买到WBETH，我是否能获得WBETH中累积的奖励？&quot;">​</a></h2><p>是的，即使WBETH是从市场上买入、充值到交易平台中或是从BinanceETH质押中获得，WBETH仍会累积奖励。</p><h2 id="质押奖励何时发放以及如何发放" tabindex="-1">质押奖励何时发放以及如何发放？ <a class="header-anchor" href="#质押奖励何时发放以及如何发放" aria-label="Permalink to &quot;质押奖励何时发放以及如何发放？&quot;">​</a></h2><p>所持有的WBETH代表质押的ETH加上质押奖励。奖励不会直接发放到您的现货钱包。反之，获得的奖励会以WBETH价值增加的形式累积起来。这种价值的增加反映在每天08:00 (UTC+8)更新的WBETH∶BETH兑换率上。您可以在BinanceETH质押页面的WBETH奖励历史处查看获得的ETH奖励价值记录。 对于BETH，质押奖励将以BETH的形式每天于12:00至18:00(UTC+8)发放到您的现货钱包。</p><h2 id="在哪里可以查看个人的质押余额" tabindex="-1">在哪里可以查看个人的质押余额？ <a class="header-anchor" href="#在哪里可以查看个人的质押余额" aria-label="Permalink to &quot;在哪里可以查看个人的质押余额？&quot;">​</a></h2><p>登录到Binance账户并导航到BinanceETH质押页面后，您可以查看质押的ETH余额。</p><h2 id="我可以在哪里查看质押奖励记录" tabindex="-1">我可以在哪里查看质押奖励记录？ <a class="header-anchor" href="#我可以在哪里查看质押奖励记录" aria-label="Permalink to &quot;我可以在哪里查看质押奖励记录？&quot;">​</a></h2><p>登录到Binance账户并导航到BinanceETH质押后，您可以查看累积奖励。</p><p>如要查看BETH奖励，也您可以查看ETH质押历史。</p><h2 id="如何赎回我质押的eth" tabindex="-1">如何赎回我质押的ETH？ <a class="header-anchor" href="#如何赎回我质押的eth" aria-label="Permalink to &quot;如何赎回我质押的ETH？&quot;">​</a></h2><p>您可以在BinanceETH质押页面使用质押中的ETH赎回ETH。 WBETH持有者可基于赎回时适用的WBETH∶ETH的比率用WBETH赎回为ETH。 BETH持有者可以按照1∶1的比率用其BETH赎回为ETH。 请注意，由于以太坊网络存在处理限制，每日赎回配额受限。赎回处理时间不定。请在赎回页面上查看发放时间。</p><h2 id="可赎回的质押eth数量是否有限制" tabindex="-1">可赎回的质押ETH数量是否有限制？ <a class="header-anchor" href="#可赎回的质押eth数量是否有限制" aria-label="Permalink to &quot;可赎回的质押ETH数量是否有限制？&quot;">​</a></h2><p>是的，由于以太坊网络的费率限制设置，每天仅限解质押限量的ETH。BinanceETH质押上的赎回池是根据从网络上收到的金额进行补充的。 因此，每日质押的ETH的赎回配额将分配给每位Binance用户。个人配额基于每位用户过去在Binance现货账户、资金账户、理财账户、Binance借币抵押品账户、杠杆账户和统一账户中的质押ETH的平均持有量：</p><ul><li>过去15天的平均持有量 &lt; 100质押ETH：最高为每天质押ETH的50</li><li>过去15天的平均持有量 &gt;= 100质押ETH：最高为每天质押ETH平均持有量的30%。 您质押的ETH持有量 = WBETH持有量 x WBETH∶ETH兑换率 + BETH持有量 请谨慎考虑不确定性。链上每日赎回配额用完后，Binance将无法从以太坊网络中解除质押ETH，因此，在配额再次可用之前，您可能无法用BETH赎回为ETH。个人每日赎回配额如有变更，恕不另行通知。</li></ul><h2 id="个人每日赎回额度何时重置" tabindex="-1">个人每日赎回额度何时重置？ <a class="header-anchor" href="#个人每日赎回额度何时重置" aria-label="Permalink to &quot;个人每日赎回额度何时重置？&quot;">​</a></h2><p>个人质押的ETH每日赎回配额将于08:00 (UTC+8)重置。</p><h2 id="平台的总赎回限额何时补充" tabindex="-1">平台的总赎回限额何时补充？ <a class="header-anchor" href="#平台的总赎回限额何时补充" aria-label="Permalink to &quot;平台的总赎回限额何时补充？&quot;">​</a></h2><p>根据Binance从以太坊网络解除质押的ETH数量，赎回池会在一天当中逐步补充，以维护公平的分配。为确保用户体验流畅，赎回池补充的时间和配额可能会作出相应调整。赎回时，您将与其他用户共享池中的ETH金额。</p><h2 id="如用wbeth或beth赎回eth-何时会收到eth" tabindex="-1">如用WBETH或BETH赎回ETH，何时会收到ETH？ <a class="header-anchor" href="#如用wbeth或beth赎回eth-何时会收到eth" aria-label="Permalink to &quot;如用WBETH或BETH赎回ETH，何时会收到ETH？&quot;">​</a></h2><p>成功提交赎回请求7天后，解除质押的ETH将记入您的现货钱包。 请注意，ETH赎回需要排队。ETH提现请求的处理时长取决于您提出赎回请求时，市场对ETH质押提现的需求量。 等待期如有变更，恕不另行通知。 但是，等待期的变更不具有追溯性，只适用于变更后的新请求，即赎回请求提交后。您收到ETH的时间是固定的，您可以在交易历史记录中查看到账时间。 如果您需要立即平仓ETH质押仓位，可以将BETH封装为WBETH，然后在Binance现货市场上交易WBETH。</p><h2 id="如果我用我的wbeth或beth赎回eth-我还能获得每日奖励吗" tabindex="-1">如果我用我的WBETH或BETH赎回ETH，我还能获得每日奖励吗？ <a class="header-anchor" href="#如果我用我的wbeth或beth赎回eth-我还能获得每日奖励吗" aria-label="Permalink to &quot;如果我用我的WBETH或BETH赎回ETH，我还能获得每日奖励吗？&quot;">​</a></h2><p>否，您赎回/出售的WBETH或BETH部分将不会再获得每日奖励。</p><h2 id="如果我将持有的wbeth或beth出售-转账给他人会怎样" tabindex="-1">如果我将持有的WBETH或BETH出售/转账给他人会怎样？ <a class="header-anchor" href="#如果我将持有的wbeth或beth出售-转账给他人会怎样" aria-label="Permalink to &quot;如果我将持有的WBETH或BETH出售/转账给他人会怎样？&quot;">​</a></h2><p>如果您将自己的WBETH或BETH出售/划转，那么您质押的ETH和相应的奖励（已累积的奖励和未来的奖励）的所有权将转给买方。</p><h2 id="确认开始赎回后-是否可以停止赎回" tabindex="-1">确认开始赎回后，是否可以停止赎回？ <a class="header-anchor" href="#确认开始赎回后-是否可以停止赎回" aria-label="Permalink to &quot;确认开始赎回后，是否可以停止赎回？&quot;">​</a></h2><p>否，该赎回流程不可逆。然而，收到ETH后，您可以将其重新质押或兑换为WBETH。</p>',29)]))}const c=e(E,[["render",H]]);export{B as __pageData,c as default};
